import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Demo from '../components/Demo';
// products components
import Products from '../components/Admin/Products';
import Product_detail from '../components/Admin/Products/Product_detail.js';
import Add_product from '../components/Admin/Products/Add_product.js';
// front end
import Home from '../components/Customer/Home';
import ProductDetail from '../components/Customer/ProductDetail';

const Router_website = ({ data, onRemove }) => {
	return (
		<>
			<Router>
		        <Switch>
			          <Route path="/admin/product/:id">
						<Product_detail data={data} />						
			          </Route>
			          <Route path="/admin/add-product">
						<Add_product />						
			          </Route>
			          <Route path="/admin/products">
						<Products data={data} onRemove={onRemove} />						
			          </Route>
			          <Route path="/admin/dashboard">
						<Demo />						
			          </Route>
			          <Route path="/home">
						<Home data={data} />						
			          </Route>
			          <Route path="/:id">
						<ProductDetail data={data} />						
			          </Route>
		        </Switch>
		    </Router>
		</>
	)
}

export default Router_website
